import React, {Component} from 'react';
import Link from "react-router-dom";

class Test extends Component {
    render() {
        return (
            <div>
                <h1>hellow I am A Test Component {this.props.match.params.postid}</h1>
                <Link to="/">Back To Home</Link>
            </div>
        );
    }
}

export default Test;
